import{_ as e,c as t,o as r,a}from"./app.8174fb79.js";const g=JSON.parse('{"title":"Interactive audiovisual design","description":"","frontmatter":{},"headers":[{"level":2,"title":"After Effects","slug":"after-effects","link":"#after-effects","children":[]},{"level":2,"title":"P5 and interactive sites","slug":"p5-and-interactive-sites","link":"#p5-and-interactive-sites","children":[{"level":3,"title":"Interesting people / websites","slug":"interesting-people-websites","link":"#interesting-people-websites","children":[]}]},{"level":2,"title":"Resolume","slug":"resolume","link":"#resolume","children":[]},{"level":2,"title":"TouchDesigner","slug":"touchdesigner","link":"#touchdesigner","children":[]}],"relativePath":"index.md"}'),i={name:"index.md"},s=a('<h1 id="interactive-audiovisual-design" tabindex="-1">Interactive audiovisual design <a class="header-anchor" href="#interactive-audiovisual-design" aria-hidden="true">#</a></h1><p>In this course we will learn how to transfer our audiovisual knowledge and assets to an interactive design. The course will consist of different programs whom we will discover trough small assignments and knowledge clips.</p><h2 id="after-effects" tabindex="-1">After Effects <a class="header-anchor" href="#after-effects" aria-hidden="true">#</a></h2><blockquote><p>Adobe After Effects is a powerful tool used for creating captivating visual effects, animations, and compositing for film, television, video, and web content.</p></blockquote><p>In this course, we&#39;ll explore the fundamentals of After Effects, from understanding the interface to mastering key techniques. By the end of this course, you&#39;ll be equipped with the knowledge and skills to bring your creative visions to life.</p><h2 id="p5-and-interactive-sites" tabindex="-1">P5 and interactive sites <a class="header-anchor" href="#p5-and-interactive-sites" aria-hidden="true">#</a></h2><blockquote><p>p5.js is a JavaScript library for creative coding, with a focus on making coding accessible and inclusive for artists, designers, educators, beginners, and anyone else! p5.js is free and open-source because we believe software, and the tools to learn it, should be accessible to everyone.</p></blockquote><blockquote><p>Using the metaphor of a sketch, p5.js has a full set of drawing functionality. However, you’re not limited to your drawing canvas. You can think of your whole browser page as your sketch, including HTML5 objects for text, input, video, webcam, and sound.</p></blockquote><p>from <a href="https://p5js.org/" target="_blank" rel="noreferrer">p5.org</a></p><p>P5 evolved from Processing, a library with a custom IDE loved by many free spirits and generative coders. They still share the same open-source idea&#39;s and have contributors from all round the world.</p><h3 id="interesting-people-websites" tabindex="-1">Interesting people / websites <a class="header-anchor" href="#interesting-people-websites" aria-hidden="true">#</a></h3><p><a href="https://thecodingtrain.com/tracks/code-programming-with-p5-js" target="_blank" rel="noreferrer">Coding Train</a></p><p><a href="https://www.youtube.com/@timrodenbroeker" target="_blank" rel="noreferrer">Tim Rodenbröker</a></p><p><a href="https://www.youtube.com/watch?v=xOCUrAN7rjs" target="_blank" rel="noreferrer">GridType</a></p><p><a href="https://www.youtube.com/@StevesMakerspace" target="_blank" rel="noreferrer">Steve&#39;s Makerspace</a></p><p><a href="https://www.youtube.com/watch?v=UsIF5r8rAvk" target="_blank" rel="noreferrer">ph4se space</a></p><p><a href="https://www.youtube.com/watch?v=HQZp4pYYzhI&amp;list=PLnyhHTSmcsEncMbNDVre2nh3OLXSW9LH2" target="_blank" rel="noreferrer">weidi</a></p><p><a href="https://www.youtube.com/playlist?list=PLzSs5srqbLqJhRehvusk2adFaexKHXicC" target="_blank" rel="noreferrer">Nekodigi Graphics Artist</a></p><h2 id="resolume" tabindex="-1">Resolume <a class="header-anchor" href="#resolume" aria-hidden="true">#</a></h2><blockquote><p>Resolume is a powerful virtual video jockey software that provides real-time video mixing and compositing. It is a tool for VJs, AV performers and video artists. It is a software that allows you to mix and match your visuals quickly and easily.</p></blockquote><h2 id="touchdesigner" tabindex="-1">TouchDesigner <a class="header-anchor" href="#touchdesigner" aria-hidden="true">#</a></h2><blockquote><p>TouchDesigner is a visual development platform that equips you with the tools you need to create stunning real-time projects and rich user experiences. Whether you&#39;re creating interactive media systems, architectural projections, live music visuals, or simply rapid-prototyping your latest creative impulse, TouchDesigner is the platform that can do it all.</p></blockquote>',22),o=[s];function n(l,c,d,h,u,p){return r(),t("div",null,o)}const m=e(i,[["render",n]]);export{g as __pageData,m as default};
